    {
        icon: FaCocktail,
        title: 'free Cocktails',
        info: 'Lorem ipsum dolor sit amet consecetur adipisicing elit. Magni,corporis!',
    },
    {
        icon: <FaHiking />,
        title: 'Endless Hiking',
        info: 'Lorem ipsum dolor sit amet consecetur adipisicing elit. Magni,corporis!',
    },
    {
        icon: <FaShuttleVan />,
        title: 'free Shuttle',
        info: 'Lorem ipsum dolor sit amet consecetur adipisicing elit. Magni,corporis!',
    },
    {
        icon: <FaBeer />,
        title: 'Strongest Bear',
        info: 'Lorem ipsum dolor sit amet consecetur adipisicing elit. Magni,corporis!',
    }
]

export default ServiceData;
